import React from "react";
import { BrowserRouter as Router, Routes, Route, useLocation } from "react-router-dom";
import Header from "./Pagrindinis_d/Header";
import Main from "./Pagrindinis_d/Main";
import Footer from "./Pagrindinis_d/Footer";
import Meniu from "./Meniu/meniu";
import HorizontalScroll from "./Apie_mane/apieMane"; // Import the horizontal scroll component

function Layout() {
    const location = useLocation(); // Get the current route's location

    return (
        <>
            <Header />
            <Routes>
                <Route path="/" element={<Main />} /> {/* Main page */}
                <Route path="/meniu" element={<Meniu />} /> {/* Meniu page */}
                <Route path="/apieMane" element={<HorizontalScroll />} /> {/* Horizontal scroll page */}
            </Routes>

        </>
    );
}

function App() {
    return (
        <Router>
            <Layout />
        </Router>
    );
}

export default App;
